import './App.css';
import Header from './Header';
import Post from './Post';
import {Route, Routes} from "react-router-dom";

function App() {
  return (
    <Routes>
      <Route index element ={<main>
      <Header />
      <Post />
      <Post />
      <Post />
    </main>}></Route>
    </Routes>
  );
}

export default App;
